import React from 'react';
import './App.css';
import Certifications from './components/certifications';
import './app.scss';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>My name is George Payne. How's it going, guys?</p>
        <p>
          These are my course certifications in descending order of date
          completed.
        </p>
        <p>
          Visitor, ask yourself. Whould this person have all these
          certifications???
        </p>
      </header>
      <Certifications />
    </div>
  );
}

export default App;
